import { FaBars, FaTimes } from "react-icons/fa";

function Navbar() {
  return (
    <header>
      <h3>Windsor Precision Works</h3>
      <nav>
        <a href="/#">Home</a>
        <a href="/#">Services</a>
        <a href="/#">Equipment</a>
        <a href="/#">Contact Us</a>
        <button>
          <FaTimes />
        </button>
      </nav>
      <button>
        <FaBars />
      </button>
    </header>
  );
}

export default Navbar;
